import { Component, EventEmitter, Input, Output } from '@angular/core';

@Component({
  selector: 'app-signup-layout',
  standalone: true,
  imports: [],
  templateUrl: './signup-layout.component.html',
  styleUrl: './signup-layout.component.scss'
})
export class SignupLayoutComponent {
  @Input() title: string = "";
  @Input() primaryBtnText: string = "";
  @Input() secondaryBtnText: string = "";
  @Input() disablePrimaryBtn: boolean = true;
  @Output("submit") onSubmit = new EventEmitter();

  @Output("navigate") onNavigate = new EventEmitter();
  
  submit(){
    this.onSubmit.emit();
  }

  navigate(){
    this.onNavigate.emit();
  }
}
<main>
    <section class="background">
        <div class="backopacity"></div>
        <img src="/assets/svg/background.png" class="background-image">
    </section>
    
    <div class="form-section">

        <div class="form-column-primary">
        
            <img src="/assets/svg/logo.png" alt="Logo"/>

            <h2>{{ title }}</h2>
            <div class="content-form">
            <ng-content></ng-content>

            <div class="btn-wrapper">
            
                <button 
                    class="btn-primary" 
                    (click)="submit()"
                    [disabled]="disablePrimaryBtn"
                >
                    {{ primaryBtnText }}
                </button>

                <button class="btn-secondary" (click)="navigate()">{{ secondaryBtnText }}</button>
                
            </div>
        </div>
    </div>
        
        <div class="form-column-secondary">
            <img src="/assets/svg/background-secondary.svg" alt="image"/>
            <span>Entry to this is restricted to employees and affiliates.</span>
        </div>
    </div>

    <div class="footer">
        <span>Terms of Use | Browser and Display Compatibility Copyright © 2024 </span>
    </div>
</main>
